import React from 'react';
import './App.css';
import {BrowserRouter, Route } from "react-router-dom";
import Teacher from './components/Teacher/Teacher'
import Student from './components/Student/Student';
import HomePage from './HomePage/HomePage';
import Admin from './components/Admin/Admin';
import 'bootstrap/dist/css/bootstrap.min.css';
import AddSession from './components/Admin/Add_Session/addSession';


function App() {
  return (
    <BrowserRouter>
      <Route exact path="/" render={()=><HomePage/>}></Route>
      <Route  path="/teacher" render={() => <Teacher />}></Route>
      <Route  path="/student" render={() => <Student />}></Route>
      <Route  path="/admin" render={() => <Admin />}></Route>
      <Route  path="/admin_add_session" render={() => <AddSession />}></Route>

    </BrowserRouter>
  );
}

export default App;
